function Goodbye() {
  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-4xl font-bold text-blue-900 mb-4">Goodbye!</h1>
        <p className="text-lg text-gray-700">Thank you for using the Attendance Management System. You can now close this tab.</p>
      </div>
    </div>
  );
}

export default Goodbye;
